int32_t create_vop2(int32_t op, int32_t vdst, int32_t vsrc1, int32_t src0){
	/* VOP2 instruction format:
	 * MSB -> LSB
	 * | ENC(1) = 1'b0 | OP(6) | VDST(8) | VSRC1(8) | SRC0(9) |
	 */
	int32_t inst = 0x00000000;
	op = op << 25;
	vdst = vdst << 17;
	vsrc1 = vsrc1 << 9;
	inst = inst | op | vdst | vsrc1 | src0;
	return(inst);
}
