        timer = XTmrCtr_GetValue(&XPS_Timer, 0);


    	for (counter = 0; counter < n_points; counter++)
    	{
    		XIo_Out32(NEKO_MEM_WR_ADDR,membership_address+counter*4);
    		//XIo_In32(NEKO_MEM_WR_DATA,membership[bram_counter]);
    		n_membership = XIo_In32(NEKO_MEM_RD_DATA);
    		int cluster_id = n_membership;
    		new_centers_len[cluster_id]++;
    		if (n_membership != membership[counter])
    		{
    			delta++;
    			membership[counter] = n_membership;

    		}
    		for (j = 0; j < n_features; j++)
    		{
    			//XIo_Out32(NEKO_MEM_WR_ADDR,features_address+(j*n_points+counter)*4);
    			//aux.u = XIo_In32(NEKO_MEM_RD_DATA);
    			aux.u = features[j*n_points+counter];
    			new_centers[cluster_id*n_features+j].f += aux.f;
    		}
    	}

    	for (i=0; i<n_clusters; i++) {
    		for (j=0; j<n_features; j++) {
    			if (new_centers_len[i] > 0){
    				aux.f = new_centers[i*n_features+j].f / (1.0f*new_centers_len[i]);
    				clusters[i*n_features+j] = aux.u;	// take average i.e. sum/n

    			}
    			new_centers[i*n_features+j].f = 0.0f;	// set back to 0
    		}
    		new_centers_len[i] = 0;			// set back to 0
    	}

    	XTmrCtr_Stop(&XPS_Timer, 0);
    	timer = XTmrCtr_GetValue(&XPS_Timer, 0)-timer;
    	xil_printf("time dif= %d\n\r",timer);


